import React from "react";
import "./index.css";

function TwoSec(props){
    return(
           <div className="card">
               <img src={ props.imgSrc}/>
               <h6>{ props.h6}</h6>
               <hr/>
               <h2>{ props.h2}</h2>
               <p>{props.para}</p>
               <button>LEARN MORE</button>
           </div>
    );
}
export default TwoSec;
